<H1><A NAME="vb_e_terrregbadregistration"></A>Component is not correctly registered.</H1>

<P class=T>This error generally occurs when the registry has been corrupted, the system cannot access the registry, or an item was written to the registry with an incorrect format.</P>

<P><B>To correct this error</B>

<UL>
	<LI class=LB1>Re-install the component.</LI>
</UL>
